// Parse AI output and extract score
const output = $input.item.json.output || "";
const scoreMatch = output.match(/Score:\s*(\d+)/);
const score = scoreMatch ? parseInt(scoreMatch[1]) : 0;

// Extract other details
const missingMatch = output.match(/Missing:\s*(.+?)(?:\n|$)/);
const missing = missingMatch ? missingMatch[1].trim() : "None";

const recsMatch = output.match(/Recommendations:\s*(.+?)(?:\n|$)/);
const recommendations = recsMatch ? recsMatch[1].trim() : "None";

const statusMatch = output.match(/Status:\s*(.+?)(?:\n|$)/);
const status = statusMatch ? statusMatch[1].trim() : "Unknown";

return {
  json: {
    ...$input.item.json,
    score: score,
    missing_items: missing,
    recommendations: recommendations,
    status: status,
    full_analysis: output
  }
};

